	public static function getLocaleFromCookie() {
		if(isset($_COOKIE['default_locale'])) {
			return in_array($_COOKIE['default_locale'], Config::get('site.available_locales')) ? $_COOKIE['default_locale'] : Config::get('site.default_locale');
		}
		
		return Config::get('site.default_locale');
	}
